import './Petitem.css';


function PetItem( { pet:{ name, image, age, gender, status, shelter } }) {


    return (
        <div class="col-md-4">
            <div class="card">
                <div class="img-container">
                    <div class="d-flex justify-content-between align-items-center p-2 first"> <span class="percent">-25%</span> <span class="wishlist"><i class="fa fa-heart"></i></span> </div> <img alt={name} src={image} class="img-fluid"/>
                </div>
                <div class="product-detail-container">
                    <div class="d-flex justify-content-between align-items-center">
                        <h6 class="mb-0">Long sleev shirt</h6> <span class="text-danger font-weight-bold">$3.99</span>
                    </div>
                    <div class="d-flex justify-content-between align-items-center mt-2">
                        <div class="ratings"> <i class="fa fa-star"></i> <span>4.5</span> </div>
                    </div>
                    <div class="mt-3"> <button class="btn btn-danger btn-block">Buy Now</button> </div>
                </div>
            </div>
        </div>
    );
}

export default PetItem;
